import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Navbar from "./Components/Navbar";
import Campionato from "./Components/Pages/Campionato";
import Roster from "./Components/Pages/Roster";
import Store from "./Components/Pages/Store";
import About from "./Components/Pages/About";
import Sponsor from "./Components/Pages/Sponsor";
import Contacts from "./Components/Pages/Contacts";

import "./App.css";

/* Placeholder component (se presente nel progetto originale) */
function Placeholder({ title }) {
  return (
    <main className="site-inner">
      <h1>{title}</h1>
      <p>Contenuto di esempio...</p>
    </main>
  );
}

export default function App() {
  return (
    <BrowserRouter>
      {/* DIV che gestisce lo sfondo fisso: resta sotto ai contenuti */}
      <div id="bg-fixed" role="presentation" />

      <div className="App">
        <Navbar />

        {/* Main router area */}
        <Routes>
          <Route path="/" element={<Campionato />} />
          <Route path="/campionato" element={<Campionato />} />
          <Route path="/roster" element={<Roster />} />
          <Route path="/store" element={<Store />} />
          <Route path="/about" element={<About />} />
          <Route path="/sponsor" element={<Sponsor />} />
          <Route path="/contacts" element={<Contacts />} />

          {/* Fallback / example routes, tienili o rimuovili se non servono */}
          <Route path="/placeholder" element={<Placeholder title="Placeholder" />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
